import { BrowserRouter, Route, Routes, Link} from 'react-router-dom';
import React from 'react';
import mainBTN from './mainBTN.css';

function Main() {
  return (
    <body>
      <h1>P:LOW</h1>
      <div>
        <center>
        <img className="mainLogo" src="img/logo.png" alt="로딩 실패" width="250" height="150"/>
        </center>
      </div>
      <Link to ="/user">
        <button className="main-btn">사용자</button>
      </Link>
      <Link to ="/institute">
        <button className="main-btn">조회 기관</button>
      </Link>
      <Link to ="blood">
        <button className="main-btn">헌혈 기관</button>
      </Link>
    </body>
  );
}

export default Main;
